    atk_widget_t *btn = atk_widget_create(&ATK_BUTTON_CLASS);
    if (!btn)
    {
        return 0;
    }

    btn->x = rel_x;
    btn->y = rel_y;
    btn->width = width;
    btn->height = height;
    btn->parent = window;

    atk_button_configure(btn,
                         title,
                         style,
                         draggable,
                         false,
                         action,
                         context);
    atk_list_node_t *child_node = atk_list_push_back(&priv->children, btn);
    if (!child_node)
