   100	        return -1;
   101	    }
   102	
   103	    bool readable = (flags & SYSCALL_OPEN_READ) != 0;
   104	    bool writable = (flags & SYSCALL_OPEN_WRITE) != 0;
   105	    if (!readable && !writable)
   106	    {
   107	        return -1;
   108	    }
   109	    bool create = (flags & SYSCALL_OPEN_CREATE) != 0;
   110	    bool truncate = (flags & SYSCALL_OPEN_TRUNCATE) != 0;
   111	
   112	    vfs_node_t *node = vfs_open_file(vfs_root(), path, create, truncate && writable);
